import React from 'react'
import { Allrestaurants } from '../../../interfaces/Restaurant'


export default function DesktopRestaurant(props:String) {
    console.log(props)
    const f = Allrestaurants.filter(res => props === res.name);
  return (
    <div>
        {f.map(res=> 
        <div>
            <img src={res.PictureURL} alt=''/>
            <p> {res.name} </p>
            <p> {res.Status} </p>
            </div>
            )}
    </div>

  )

}
